import re
def parse_color_data(text):
    """
    Parses color data from a text string, extracting color names and hex codes.

    Args:
      text: The input text string containing color data.

    Returns:
      A list of strings, where each string is either a color name or a hex code.
    """

    color_data = []
    words = text.split()

    for word in words:
        # If '#' is in the word, split on '#' and keep the second part
        if '#' in word:
            parts = word.split('#')
            color_data.append('#' + parts[-1])  # Add the '#' back
        elif re.search('[a-zA-Z]', word):
            split_index = re.search('[a-zA-Z]', word).start()
            color_data.append(word[split_index:])
            color_data.append(word)

    return color_data

